def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []

    for block in data.blocks:
        # Assuming `block` is a VertBlock
        result = None
        if isinstance(block, VertBlock):
            block_values = block.values
            if hasattr(block_values, "hasna") and block_values.hasna:
                # Handle Nullable IntegerArray appropriately
                result = block_values.astype(float).mean(axis=1)
            else:
                result = block_values.mean(axis=1)
        else:
            result = block_values.mean(axis=1)

        agg_block: Block = block.make_block(result)
        agg_blocks.append(agg_block)

    agg_items = data.items
    # Reset block locs
    for i in range(len(agg_blocks)):
        offset = i * len(agg_blocks[i])
        agg_blocks[i].mgr_locs = indexer[offset : (offset + len(agg_blocks[i]))]

    return agg_blocks, agg_items
